import "./landing.css";

export default function Landing() {
	return (
		<section id="Landing" className="h-screen bg-[length:100%_100%]">
			<div className="container mx-auto">
				<div className="grid grid-cols-12">
					<div className="col-span-2">
						<div className="subHead bg-gradient-to-r from-indigo-400 via-pink-300 to-rose-400 bg-clip-text text-transparent text-2xl">
							<i>"</i>&nbsp;Tech it Easy&nbsp;<i>"</i>
						</div>
					</div>
				</div>
			</div>
		</section>
	);
}
